import React from 'react';
import ReacrDOM from 'react-dom';

const App = () => {
    window.navigator.geolocation.getCurrentPosition(
        position => console.log(position),
        err => console.log(err)
    );

    return (
        <div>Latitude: </div>
    );
}

ReacrDOM.render(
    <App />,
    document.querySelector('#root')
);
